import React, { Component } from 'react';

class Profile extends Component {
  render() {
    const { username, tag, location, avatar, stats } = this.props;
    return (
      <div>
        {username}
        {tag}
        {location}
        {avatar}
      </div>
    );
  }
}

export default Profile;
